/**
 * Adds a figure to the list of figures. Initializes the
 * the figure's container.
 */
public Figure add(Figure figure) {
    if (!fFigures.contains(figure)) {
        fFigures.addElement(figure);
        figure.addToContainer(this);
    }
    return figure;
}
